import React from "react";
import { TextField, Button, Paper, Typography, Stack } from "@mui/material";

export default function ProfileInfo() {
  const inputStyle = {
    "& .MuiTextField-root": {
      paddingBottom: "10px",
      fontSize: "10px",
    },
    "& .MuiButton-root": { fontSize: "12px", px: 4, py: 1.5 },
  };
  return (
    <>
      <Stack
        dir="rtl"
        direction="row"
        spacing={5}
        sx={{
          mt: "-64px",
          justifyContent: "center",
          alignItems: "center",
          "& .MuiTextField-root": {
            paddingBottom: "10px",
            fontSize: "10px",
          },
          "& .MuiButton-root": { fontSize: "12px", px: 4, py: 1.5 },
        }}
      >
        <form>
          <TextField
            sx={inputStyle}
            fullWidth
            label="نام کاربری"
            variant="outlined"
          />
          <TextField
            sx={inputStyle}
            fullWidth
            label="رمز عبور"
            variant="outlined"
          />
        </form>
      </Stack>
    </>
  );
}
